import { Fragment } from "react";



const App = () => {

  const prices = {
    arak
  }

  return (
    <section 
      style={{
      display: "flex",
      width: "100vw",
      height: "100vh",
      justifyContent: "center",
      alignItems: "center"
    }}>
      <button>Arak</button>
      <button>Osaris</button>
      <button>Garrogat</button>
    </section>
  )
}

export default App;
